import * as React from 'react';
import Box from '@mui/material/Box';
import Avatar from '@mui/material/Avatar';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import IconButton from '@mui/material/IconButton';
import Tooltip from '@mui/material/Tooltip';
import PersonAdd from '@mui/icons-material/PersonAdd';
import Settings from '@mui/icons-material/Settings';
import Logout from '@mui/icons-material/Logout';
import Member01 from './member/Member01';

function MenuIcon() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  return (
    <React.Fragment>
      <Box sx={{ display: 'flex', alignItems: 'center', textAlign: 'center',}}>
        <Tooltip title="Menu">
          <IconButton
            onClick={handleClick}
            size="small"
            sx={{ ml: 2,}}
            aria-controls={open ? 'menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
          >
            <Avatar>
              <img src="https://cdn-icons-png.flaticon.com/512/55/55003.png" style={{width:"16px"}}></img>
            </Avatar>
          </IconButton>
        </Tooltip>
      </Box>
      <div className="menu-in" style={{color:""}}>
      <Menu
        anchorEl={anchorEl}
        id="menu"
        open={open}
        onClose={handleClose}
        onClick={handleClose}
      >
        <MenuItem onClick={handleClose}>
        <a href="/" className="navbar-link">HOME</a>
        </MenuItem>
        <MenuItem onClick={handleClose}>
        <a href="/discography" className="navbar-link">DISCOGRAPHY</a>
        </MenuItem>
        <MenuItem onClick={handleClose}>
        <a href="/notice" className="navbar-link">NOTICE</a>
        </MenuItem>
        <MenuItem onClick={handleClose}>
        <a href="/schedule" className="navbar-link">SCHEDULE</a>
        </MenuItem>
        <MenuItem onClick={handleClose}>
        <a href="/contact" className="navbar-link">CONTACT</a>
        </MenuItem>
        <MenuItem onClick={handleClose}>
        <a href="/about" className="navbar-link">ABOUT</a>
        </MenuItem>
      </Menu>
      </div>
    </React.Fragment>
  );
}
export default MenuIcon;
